import React, {Component} from 'react';
import { connect } from 'react-redux';
import { getMyPokemonList } from '../../store/actions'
import { ListItem } from '../../components/organisms';

class MyPokemonList extends Component {
    componentDidMount(){
        return this.props.getMyPokemonList();      
    }
    render(){       
        return (
            <ListItem
                from="owned"
                failed={false}
                isLoading={this.props.isLoading}
                list={this.props.myPokemon} />
        )
    }

}

const mapStateToProps = (state)=>({
  myPokemon: state.pokemon.myPokemon,
  isLoading: state.pokemon.isLoading,
}) 
const mapDispatchToProps = {
    getPokemonList
} 

export default connect(mapStateToProps,mapDispatchToProps)(MyPokemonList)
